public int[] process(int max) { 
  int[] cs = {1, 3, 5}; 
  int[] ms = new int[max]; 
  Arrays.fill(ms, max * 10); 
  ms[0] = 0; 
  for(int i = 1; i < ms.length; i++) 
    for(int j = 0; j < cs.length; j++) 
      if(cs[j] <= i) { 
        int t = ms[i - cs[j]] + 1; 
        if(t < ms[i]) 
          ms[i] = t; 
      } 
  return ms; 
} 

